CREATE TABLE "public"."algorithm_results" ("id" serial NOT NULL, "algorithm_setting_id" integer NOT NULL, "algorithm_id" integer NOT NULL, "result" jsonb, PRIMARY KEY ("id") , FOREIGN KEY ("algorithm_id") REFERENCES "public"."algorithms"("id") ON UPDATE no action ON DELETE no action, FOREIGN KEY ("algorithm_setting_id") REFERENCES "public"."algorithm_settings"("id") ON UPDATE no action ON DELETE no action, UNIQUE ("id"));
